/* @flow */
import * as React from 'react'

import Button from './/atoms/button'

type Props = {
  children?: React.Node,
  className?: string,
  title: string,
  button?: string,
}

const Block = (props: Props): React.Element<*> => {
  return (
    <div class="header__inner">
      <div class="header__container">
        <Button />
      </div>
    </div>
  );
};

Block.defaultProps = {
  className: '',
  children: '',
  title: '',
  button: '',
}

export default Block
